# plot diagnostic learning curves
def summarize_diagnostics(history):
    # plot loss
    pyplot.subplot(211)
    pyplot.title('Cross Entropy Loss')
    pyplot.plot(history.history['loss'], color='blue', label='train')
    pyplot.plot(history.history['val_loss'], color='orange', label='test')
    pyplot.yscale('log')
    pyplot.legend()

    # plot accuracy
    pyplot.subplot(212)
    pyplot.title('Classification Accuracy')
    pyplot.plot(history.history['accuracy'], color='blue', label='train')
    pyplot.plot(history.history['val_accuracy'], color='orange', label='test')
    pyplot.legend()
    # save plot to file
    

    filename = sys.argv[0].split('/')[-1]
    pyplot.savefig(filename + '_plot.png')

    pyplot.show()
    pyplot.close()


#Data creation
def Data_creation(sizextr,sizex,E,At):

    #E is the vector of measurements for users
    #At is the vector of measurements for Attacker


    Y_out=[] #Output array
    Final=[] #Input array
    Mean=[]  #Temporary array of Means depending on mu

    #Combines E and At into Final (X input) and Y_out (Y output) vectors
    for i in range(len(E)):
        E[i] = [int(numeric_string) for numeric_string in E[i]]
        Final.append(E[i])
        Y_out.append([1]) #1 is user
        

        #At
    for i in range(len(At)):
        At[i] = [int(numeric_string) for numeric_string in At[i]]
       

        Final.append(At[i])
        Y_out.append([0]) #0 is attacker

    #Stores X,Y of train and test sampels
    Ax_train=[]
    Ax_test=[]
    Ay_train=[]
    Ay_test=[]

    PLen=0 # Stores size of x_test
    x_train, x_test, y_train, y_test = train_test_split(Final, Y_out, test_size=0.5, random_state = 423, shuffle=True)

    print("len(test):---------")
    print(len(x_test))
    print(x_test)
        
    A=np.arange(0.5,0.7,0.01) #vector of mu
    Menf=[] #Definitive array of means for input data depending on mu (A array)
    for i in range(len(A)):
        Mean=[]
        for k in range(len(x_test)):
    
            if (1-np.mean(x_test[k])<A[i]):
                Mean.append(0) #does not pass
            else:
                Mean.append(1) #passes

        Menf.append(Mean)


        PLen=len(x_test)


        Ax_train.append(x_train)
        Ax_test.append(x_test)
        Ay_train.append(y_train)
        Ay_test.append(y_test)



    return Ax_train, Ax_test, Ay_train, Ay_test ,Menf, PLen, A


def plot_confusion_matrix(a,cm, classes, normalize=True, title='Normalized confusion matrix', cmap=plt.cm.Blues):
    if normalize:
        cm = cm.astype('float') / cm.sum(axis=1)[:, np.newaxis]
        print("Normalized confusion matrix")
    else:
        print('Confusion matrix, without normalization')

    print(cm)
    plt.imshow(cm, interpolation='nearest', cmap=cmap)
    plt.title(title + str(a))
    plt.colorbar()
    tick_marks = np.arange(len(classes))
    plt.xticks(tick_marks, classes, rotation=90, fontsize=6)
    plt.yticks(tick_marks, classes, fontsize=6)

    fmt = '.2f' if normalize else 'd'
    thresh = cm.max() / 2.
    #for i, j in itertools.product(range(cm.shape[0]), range(cm.shape[1])):
    #    plt.text(j, i, format(cm[i, j], fmt), horizontalalignment="center", color="white" if cm[i, j] > thresh else "black")

    plt.tight_layout()
    plt.ylabel('True label')
    plt.xlabel('Predicted label')
    
    plt.savefig("Confusion_Matrix"+str(a)+".pdf")
    plt.show()


